"use strict";

function reorderedPowerOf2(n) {
    function convert(n) {
        let counter = Array(10).fill(0);
        while (n > 0) {
            counter[n % 10] += 1;
            n = Math.floor(n / 10);
        }
        return counter;
    }
    let i = 1, s = convert(n);
    while (i <= Math.pow(10, 9)) {
        if (convert(i).toString() === s.toString()) {
            return true;
        }
        i <<= 1;
    }
    return false;
}
